import React, { Component } from "react";
import styled from "styled-components";

const InputField = styled.input`
  width: 100%;
  height: 56px;
  position: relative;
  transition: 0.3s all;
  background: none;
  box-shadow: none;
  border: none;
  border-bottom: 3px solid #afa49c;
  font-family: "Montserrat", Helvetica, sans-serif;
  color: #afa49c;
  font-weight: 600;
  font-size: 50px;
  :hover {
      outline: none;
  }
  :focus {
      outline: none;
  }
}
`;

export default class TextInput extends Component {
  render() {
    return (
        <div>
            <InputField placeholder="Item name"></InputField>
        </div>
    );
  }
}
